import { SimpleGrid, ListItem, CloseButton } from '@chakra-ui/core';

const Item = (props) => {
  return (
    <ListItem>
      <SimpleGrid columns="3">
        <span>{props.product}</span>
        <span>{props.quantity}</span>
        <CloseButton textAlign="center" />
      </SimpleGrid>
    </ListItem>
  );
};

export default Item;
